import React, { useEffect } from 'react'


import routeMain from './routes'

import { useDispatch, useSelector } from "react-redux";
import { loadDetails } from "store/DetailPage/actions";
import { selectDetails } from "store/DetailPage/selectors";

import './style.scss'

import FilmListShow from './FilmListShow';

const FilmListPage = () => {
    const dispatch = useDispatch();
    const arrayListFilms = useSelector(selectDetails);

    useEffect(() => {
        dispatch(loadDetails());
    }, [dispatch])

    return (
        <section> 
            <div className='list-page__wrapp'>
            <h2 className='category__name'>Выбранная категория: Animals</h2>
                {arrayListFilms.length > 0 ? (
                    arrayListFilms.map(detail => (
                        <FilmListShow
                            list={detail}
                            key={detail.id}
                        />
                    ))
                ) : <div>пусто</div>}
            </div>
        </section>

    )
}

export { routeMain }
export default FilmListPage
